        <div className="flex justify-center items-center min-h-full">
            <div className="border border-gray-300 bg-state-300 shadow-md rounded px-8 pt-6 pb-8 mb-4">
                <table className="table-auto">

                </table>
            </div>
        </div>
    )
}

